export class LogInResult extends Component {
  componentDidMount() {
    console.log("click");
    if (this.state.userValidated) {
        this.props.navigation.navigate('/main');
    } else {
        toast.error('Log In Information incorrect.');
    }
  }
  render() {
    return (
      <div>hello</div>
    )
  }
}

const mapStateToProps = (state) => ({
    userValidated: state.userValidated
})

